import Realm from "realm";

// Declare Schema
class MovieSchema extends Realm.Object {}
MovieSchema.schema = {
    name: 'Movies',
    properties: {
        id:'int',
        title: 'string',
        genres:'string',
        overview:'string',
        posterpath:'string',
        voteaverage:  'int',
        watched: 'boolean'
    }
};

// Create realm
let Database = new Realm({schema: [MovieSchema], schemaVersion: 1});

// Export the realm
export default Database;
